import React from 'react';
import { Link } from 'react-router-dom';

const Banner = () => (
  <div className="banner">
    <div className="navlinks">
      <li><Link to="/">Posts</Link></li>
      <li><Link to="/contact">Contact</Link></li>
      </div>
  </div>
);

export default Banner;
